import React from 'react';

const DrawerToggle = (props) => {

    let attachedClasses = "DrawerToggle DrawerToggle__closed";
    if (props.open) {
        attachedClasses = "DrawerToggle DrawerToggle__open";
    }

    return (
        <div className={attachedClasses.join(' ')} onClick={props.click}>
            <div className="DrawerToggle__div1"></div>
            <div className="DrawerToggle__div2"></div>
            <div className="DrawerToggle__div3"></div>
        </div>
    )
};

export default DrawerToggle;
